import React, { Component } from 'react'
import {userConsumer} from './userContext'

class ClassC extends Component {
    render() {
        return (
            <div>
                <userConsumer>
                    {(userContext) => {
                        return  <h2> {userContext.name} </h2>
                    }}
                </userConsumer>
            </div>
        )
    }
}

export default ClassC
